import React from 'react';

import style from './style.module.scss';

const CreateToDo = (inputToDoName, setInputToDoName, createToDo) => {
  console.log(inputToDoName);
  return (
    <div className={style.main}>
      <form action="#">
        <input
          type="text"
          placeholder="Write what to do"
          value={inputToDoName}
          required
          onChange={e => setInputToDoName(e.target.value)}
        />
        <button
          onClick={createToDo}
          type="submit"
        >
          Create
        </button>
      </form>
    </div>
  );
}

export default CreateToDo;
